    props.onConfirmDeleteCard();
  }

  return (
    <PopupWithForm name="confirm" title="Вы уверены?" buttonText="Да" isOpen={props.isOpen} onClose={props.onClose} onSubmit={handleSubmit}>

    </PopupWithForm>
  );
}

